import './App.css';

const App = () => {
  const slides = [
    {url:'./me1.png'},
    {url:'./me2.png'},
    {url:'./me3.png'},
  ];
  const containerStyles = {
    width: '500px',
    height: "280px"

  }
  return (


        <div class = "homepage">
          <Navbar/>
          <Home/>
          <div style = {containerStyles}>
          <ImageSlider slides = {slides}/>
          </div>
        </div>


  );
}

export default App;
